"use strict";(self.webpackChunkfood_blog=self.webpackChunkfood_blog||[]).push([[3518],{4369:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"eendracht","metadata":{"permalink":"/eendracht","source":"@site/blog/2024-12-17-eendracht/index.md","title":"De Eendracht","description":"Dit keer gingen we lunchen bij De Eendracht. Het restaurant wat ik altijd dacht de \\"eend-racht\\" heete, maar blijkbaar de \\"een-dracht\\" heet. Anyways, een restaurant aan het water in de stad van Alkmaar, en bekend om hun beste **\\"Hamburger aan het water in Alkmaar\\" van Europa!**","date":"2024-12-17T00:00:00.000Z","tags":[{"inline":true,"label":"eendracht","permalink":"/tags/eendracht"}],"readingTime":1.28,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"eendracht","title":"De Eendracht","authors":["jordykuhne"],"tags":["eendracht"],"comments":true},"unlisted":false,"nextItem":{"title":"Foodmaster Heerhugowaard","permalink":"/foodmaster"}},"content":"Dit keer gingen we lunchen bij [De Eendracht](https://www.deeendracht-alkmaar.nl/). Het restaurant wat ik altijd dacht de \\"eend-racht\\" heete, maar blijkbaar de \\"een-dracht\\" heet. Anyways, een restaurant aan het water in de stad van Alkmaar, en bekend om hun beste _**\\"Hamburger aan het water in Alkmaar\\" van Europa!**_\\n\\n![eendracht](eendracht.jpg)\\n\\n\x3c!-- truncate --\x3e\\n\\nHet personeel was vriendelijk, maar niet heel snel. Uiteindelijk hadden we zelf maar wat menukaarten gepakt.\\n\\nIk had de _Eendracht Burger_ besteld. Een heerlijke burger met cheddar, sla, tomaat en ui met wat chips erbij.\\nHet duurde effe voordat we ons eten kregen, waarschijnlijk was Menno nog aan het slapen ofzo.\\n\\nToen we het eten kregen was het wel lekker. De kaas kon wel beter gesmolten zijn.\\nMaar de burger was goed, en de frietjes die we erbij hadden besteld waren lekker knapperig.\\nBas deed er nog wat extra zout op om zijn nieren te trainen.\\n\\n![tafel](thumbnail.jpg)\\n\\nTijdens het betalen werden we nog wel guilt-tripped om een euro te doneren voor oude vrouwtjes ofzo, maar ja, het is voor een goed doel zeggen ze dan.\\n\\n## De Rit\\n\\nRit was prima. Beetje krap met ze 5e in de auto, maar we hebben het overleefd.\\nWe kregen wel wat valse informatie over de parkeerplek, maar gelukkig was er een plekje om de hoek.\\n\\n## Cijfers\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Madelief | 7,0    |\\n| Marthijn | 8,5    |\\n| Desiree  | 7,4    |\\n| Bas      | 6,9    |\\n| Jordy    | 7,6    |\\n|**Totaal**|**7,5** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2421.634952459725!2d4.75375817702093!3d52.63044062804662!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf564adcd3c11d%3A0xf452a547c8eb0654!2sDe%20Eendracht%20Alkmaar%20in%20%C2%B4t%20IJkgebouw!5e0!3m2!1snl!2snl!4v1734551846115!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"foodmaster","metadata":{"permalink":"/foodmaster","source":"@site/blog/2024-12-13-foodmaster/index.md","title":"Foodmaster Heerhugowaard","description":"Vandaag gingen we naar... een snackbar? Foodmaster Heerhugowaard is een snackbar op de perron van station Heerhugowaard.","date":"2024-12-13T00:00:00.000Z","tags":[{"inline":true,"label":"foodmaster","permalink":"/tags/foodmaster"}],"readingTime":0.9,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"foodmaster","title":"Foodmaster Heerhugowaard","authors":["jordykuhne"],"tags":["foodmaster"],"comments":true},"unlisted":false,"prevItem":{"title":"De Eendracht","permalink":"/eendracht"},"nextItem":{"title":"Andy\'s Lunchroom (Poging 3)","permalink":"/andys-3"}},"content":"Vandaag gingen we naar... een snackbar? [Foodmaster Heerhugowaard](https://foodmasterheerhugowaard.foodticket.nl/) is een snackbar op de perron van station Heerhugowaard.\\nBekend als de... _**\\"Beste snackbar op een perron in Heerhugowaard\\" van Europa!**_ \\n\\n![station_heerhugowaard](unnamed.jpg)\\n\\n\x3c!-- truncate --\x3e\\n\\nHad een burger met een kaassouffl\xe9. De burger was prima, kaassouffl\xe9 is altijd goed.\\nVoor een snackbar was het prima eten. Binnen was ook nog een beetje gedecoreerd voor kerst.\\nIn conclusie, een prima plekje om snel wat te eten voor als je verdoemd ben om het openbaar vervoer te nemen.\\n\\n![groepsfoto](thumbnail.jpg)\\n\\n:::info\\n\\nWe zijn nog opzoek naar nieuwe segmenten voor de blog.\\nDus als je suggesties hebt, laat het ons weten in de comments hieronder.\\n\\n:::\\n\\n## De Rit\\n\\nIets langer dan normaal, het is in Heerhugowaard. Maar die Bas reed als een gek, reed bijna door rood en een hek.\\nDus al met al, kon erger.\\n\\n## Cijfers\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Madelief | -      |\\n| Desiree  | -      |\\n| Bas      | -      |\\n| Jordy    | 7,0    |\\n|**Totaal**|**7,0** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2419.4147288804775!2d4.821367077022768!3d52.67054822507206!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf5418f3f91599%3A0xa513b7bfb1af3e6a!2sFoodmaster%20Heerhugowaard!5e0!3m2!1snl!2snl!4v1734552434740!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"andys-3","metadata":{"permalink":"/andys-3","source":"@site/blog/2024-12-10-andys/index.md","title":"Andy\'s Lunchroom (Poging 3)","description":"Bonus blog! \ud83c\udf89","date":"2024-12-10T00:00:00.000Z","tags":[{"inline":true,"label":"andys","permalink":"/tags/andys"}],"readingTime":1.01,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"andys-3","title":"Andy\'s Lunchroom (Poging 3)","authors":["jordykuhne"],"tags":["andys"],"comments":true},"unlisted":false,"prevItem":{"title":"Foodmaster Heerhugowaard","permalink":"/foodmaster"},"nextItem":{"title":"Blue District","permalink":"/blue-district"}},"content":"## Bonus blog! \ud83c\udf89\\n\\nVandaag een bonus blog!\\nOmdat we hier al een paar keer zijn geweest,\\nen we al een blogpost hebben voor deze week,\\nis dit een extraatje. Vandaar ook geen cijfers.\\n\\nWe gingen weer eens naar [Andy\'s lunchroom](https://www.andyslunchroom.nl/).\\nVoor als je de [eerste blogpost van Andy\'s](/andys) niet heb gelezen,\\ndit is de snackbar waar ik verbaal werd aangevallen door meneer Andy zelf.\\nIk weet nog steeds niet waarom we telkens terug blijven komen naar deze goddeloze tent, maar het eten is wel lekker.\\n\\n![andys lunchroom](thumbnail.jpg)\\n\\n\x3c!-- truncate --\x3e\\n\\nDit keer ging ik terug naar de klassieker, de *Chicago Dog*. Uiteraard keek Andy me weer raar aan toen ik vroeg zonder saus,\\nmaar ondertussen ben ik het gewend van hem. De hotdog was weer heerlijk, en dit keer waren de tafels niet zo plakkerig als normaal.\\n\\n## De Rit \ud83d\udd25\\n\\nDe rit was weer levensgevaarlijk. We gingen met 2 auto\'s,\\nde ene auto zat telkens te toeteren en te bumperkleven,\\nen de andere auto reed als een slak.\\nEn nu durft Niels nooit meer met ons mee te rijden, wat ik wel begrijp.\\nHoop alleen dat mijn ouders dit niet lezen.\\n\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2415.013394132842!2d4.760620061046338!3d52.643738891529686!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf56515f56bf93%3A0xfa19c20dc6e7dfa2!2sAndy&#39;s%20Cafetaria!5e0!3m2!1snl!2snl!4v1727825716971!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"blue-district","metadata":{"permalink":"/blue-district","source":"@site/blog/2024-12-03-blue-district/index.md","title":"Blue District","description":"Voor deze week gingen we naar Blue District, een restaurant in Alkmaar, wat aangesloten zit aan de overprijsde winkel OFM (Only for Men), en het restaurant reflecteert die prijzen ook. Maar, ze staan wel bekend om hun **\\"Beste burgers naast een OFM\\" van Europa**.","date":"2024-12-03T00:00:00.000Z","tags":[{"inline":true,"label":"blue-district","permalink":"/tags/blue-district"}],"readingTime":0.9,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"blue-district","title":"Blue District","authors":["jordykuhne"],"tags":["blue-district"],"comments":true},"unlisted":false,"prevItem":{"title":"Andy\'s Lunchroom (Poging 3)","permalink":"/andys-3"},"nextItem":{"title":"Oliebollen!","permalink":"/oliebollen"}},"content":"Voor deze week gingen we naar [Blue District](https://www.bluedistrict.nl/), een restaurant in Alkmaar, wat aangesloten zit aan de overprijsde winkel _OFM_ (Only for Men), en het restaurant reflecteert die prijzen ook. Maar, ze staan wel bekend om hun _**\\"Beste burgers naast een OFM\\" van Europa**_.\\n\\n\x3c!-- truncate --\x3e\\n\\nIk had de _Blue District Burger_ besteld. Een grote burger met wat groen. De burger was erg lekker, en de frietjes erbij waren lekker knapperig en had de perfecte hoeveelheid zout.\\n\\n<p float=\\"left\\">\\n    <img\\n        src={require(\'./broodje.jpg\').default}\\n        alt=\\"Example banner\\"\\n        style={{width: \'49%\'}}\\n    />\\n    <img\\n        src={require(\'./thumbnail.jpg\').default}\\n        alt=\\"Example banner\\"\\n        style={{width: \'49%\'}}\\n    />\\n</p>\\n\\nWe waren de enige in het restaurant, en de _von sway_ voelde best koud aan.\\nDus voor mij was de sfeer een minpuntje.\\n\\n## De Rit \ud83d\ude97\\n\\nNiet veel speciaals te melden deze week. Behalve dat de parkeerkosten belachelijk hoog waren.\\n\\n## Cijfers\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Madelief | -      |\\n| Marthijn | -      |\\n| Desiree  | -      |\\n| Bas      | -      |\\n| Jordy    | 7,1    |\\n|**Totaal**|**7,1** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d4842.917679516004!2d4.748568977021078!3d52.633622827810754!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf57cee10f918d%3A0x4a70a92e6ae86208!2sBlue%20District%20Restaurant!5e0!3m2!1snl!2snl!4v1734640866349!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"oliebollen","metadata":{"permalink":"/oliebollen","source":"@site/blog/2024-11-19-oliebollen/index.md","title":"Oliebollen!","description":"Yeahh! Vandaag gingen we naar de Intratuin in Heerhugowaard, waar een oliebollenkraam stond met, dit is niet eens een grap dit keer, de **beste oliebollen van Noord-Holland!**","date":"2024-11-19T00:00:00.000Z","tags":[{"inline":true,"label":"oliebollen","permalink":"/tags/oliebollen"}],"readingTime":1.2,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"oliebollen","title":"Oliebollen!","authors":["jordykuhne"],"tags":["oliebollen"],"comments":true},"unlisted":false,"prevItem":{"title":"Blue District","permalink":"/blue-district"},"nextItem":{"title":"Jacky (Revisited)","permalink":"/jacky-2"}},"content":"Yeahh! Vandaag gingen we naar de Intratuin in Heerhugowaard, waar een [oliebollenkraam](https://oliebollenkraamheerhugowaard.nl/) stond met, dit is niet eens een grap dit keer, de _**beste oliebollen van Noord-Holland!**_\\n\\n![oliebollenkraam](thumbnail.jpg)\\n\\n\x3c!-- truncate --\x3e\\n\\nDeze gasten zijn de pro\'s van de oliebollen. Ze zijn op het moment van schrijven al 7 jaar bekroond met goud, en 2 jaar de winnaar van de hele offici\xeble mannetjes van [oliebollentestonline.nl](https://www.oliebollentestonline.nl/). Ze hebben allemaal verschillende smaken en rare gedrochtjes, maar ik ging voor de klassieke poedersuiker oliebol.\\n\\nEigelijk was ik vrij vandaag, maar speciaal voor deze oliebollen ben ik even langsgekomen.\\nMaar ik hoor je denken: Jordy, oliebollen is toch geen lunch?\\n\\nWas wel lekker. 10/10 zou weer schransen.\\n\\n## De Rit\\n\\nVoor mij was de rit prima, aangezien ik zelf reed.\\nMaar ik hoorde van de andere dat er een spin in de auto zat waardoor er volledige paniek uitbarste.\\n\\n## Cijfers\\n\\nHet spijt me lezer, maar we zijn helaas vergeten om een cijfer te geven.\\nDe hele essence van deze blog was om cijfers te geven aan restaurants, maar we hebben u gefaald.\\n\\nMaar het goeie nieuws is, mijn cijfer is nu het eindresultaat.\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Madelief | -      |\\n| Marthijn | -      |\\n| Desiree  | -      |\\n| Bas      | -      |\\n| Jordy    | 10     |\\n|**Totaal**|**10**  |\\n\\n## Locatie\\n\\n:::warning\\n\\nZe zijn alleen rond de feestdagen aanwezig\\n\\n:::\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2420.923620949906!2d4.7911340776276585!3d52.64329292709273!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf5664aa497aa7%3A0xd18b73265b91e41c!2sIntratuin%20Heerhugowaard%20B.V.!5e0!3m2!1snl!2snl!4v1734561926160!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"jacky-2","metadata":{"permalink":"/jacky-2","source":"@site/blog/2024-11-12-jacky/index.md","title":"Jacky (Revisited)","description":"Omdat Marthijn ziek was de vorige keer, zijn we nog een keer naar Jacky geweest. Een mooi restaurantje in Alkmaar, waar ze toevalig ook de **beste burgers van Europa hebben!**","date":"2024-11-12T00:00:00.000Z","tags":[{"inline":true,"label":"jacky","permalink":"/tags/jacky"}],"readingTime":1.185,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"jacky-2","title":"Jacky (Revisited)","authors":["jordykuhne"],"tags":["jacky"],"comments":true},"unlisted":false,"prevItem":{"title":"Oliebollen!","permalink":"/oliebollen"},"nextItem":{"title":"De Waag","permalink":"/de-waag"}},"content":"Omdat Marthijn ziek was de vorige keer, zijn we nog een keer naar [Jacky](https://jackyalkmaar.nl/) geweest. Een mooi restaurantje in Alkmaar, waar ze toevalig ook de _**beste burgers van Europa hebben!**_\\n\\n\x3c!-- truncate --\x3e\\n\\nDezelfde aardige serveerster als de vorige keer. Dit keer vertelde ze ons hoe trots ze waren op hun burgers, en dat ze de beste van Europa hadden.\\n\\n![tafel](thumbnail.jpg)\\n\\nBas zat weer te vertellen hoe hij betere smash burgers kan maken dan Jacky.\\nWe wachten nog steeds op wanneer we bij Bas thuis mogen komen eten,\\nmaar zijn zus is jarig, dus dat zal nog wel even duren.\\n\\nAls je meer wilt weten over Jacky,\\ndan kan je beter de [vorige blogpost](/jacky) lezen.\\n\\n## \u2728 De Rit \u2728\\n\\nEn nu het favoriete segment van de blog: _De Rit_!\\n\\nDe rit deze week was prima.\\nEr was genoeg parkeerplek, en het was niet eens 5 min rijden voor ons.\\nBas zat weer te vertellen over waarom de continent Afrika weg moet.\\n\\n## Cijfers\\n\\nOmdanks dat Marthijn dit keer niet ziek was, vermoed ik alsnog dat zijn vorige ervaring nog steeds invloed heeft op zijn cijfer, dus daarvoor heb ik er een puntje bij gedaan.\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Madelief | 8,0    |\\n| Marthijn | 8,5    |\\n| Desiree  | 7,5    |\\n| Bas      | 7,9    |\\n| Jordy    | 9,1    |\\n|**Totaal**|**8,2** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2421.338381275318!2d4.749031777021208!3d52.6357993276492!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf5766bfacba05%3A0x912d806b6f1cf8bf!2sJacky%20Alkmaar!5e0!3m2!1snl!2snl!4v1734649072196!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"de-waag","metadata":{"permalink":"/de-waag","source":"@site/blog/2024-11-05-de-waag/index.md","title":"De Waag","description":"Deze keer zijn we naar De Waag geweest. Een mooi restaurantje in Alkmaar, en bekend om hun **beste broodje spare-ribs van Europa!**","date":"2024-11-05T00:00:00.000Z","tags":[{"inline":true,"label":"de-waag","permalink":"/tags/de-waag"}],"readingTime":1.16,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"de-waag","title":"De Waag","authors":["jordykuhne"],"tags":["de-waag"],"comments":true},"unlisted":false,"prevItem":{"title":"Jacky (Revisited)","permalink":"/jacky-2"},"nextItem":{"title":"Andy\'s Lunchroom","permalink":"/andys"}},"content":"Deze keer zijn we naar [De Waag](https://www.dewaagalkmaar.nl/) geweest. Een mooi restaurantje in Alkmaar, en bekend om hun _**beste broodje spare-ribs van Europa!**_\\n\\n![de-waag](De-Waag-R.jpg)\\n\\n\x3c!-- truncate --\x3e\\n\\nWe hadden allemaal de _Spare-ribs_ besteld. Het eten kwam vrij snel, en was heerlijk.\\nTafeltje was ook prima. Lekker bankie, mooi hoekje, en genoeg ruimte voor iedereen.\\n\\n![tafel](thumbnail.jpg)\\n\\nAl met al een goede ervaring, en zeker een aanrader voor als je in de stad bent.\\n\\n![eten](image.png)\\n\\n## \u2728 De Rit \u2728\\n\\nWe hebben een nieuw segment in de blog: _De Rit_! Hierin bespreken we hoe de rit was naar het restaurant.\\nIk verwacht dat dit het favoriete segment wordt van de lezers!\\n\\nDe rit zelf was prima, ondanks dat Marthijn een scheetje liet.\\nMaar we moesten parkeren in de karperton, en als je de karperton kent, weet je dat het een vreselijke plek is om te parkeren.\\nEr is zelfs een [liedje](https://www.youtube.com/watch?v=3KAvKZXTXVg) over geschreven door _Krappe Sokken_. Een echte banger.\\n\\n## Cijfers\\n\\nWe missen nogsteeds een paar cijfers.\\nIk weet dat het jullie 1 na favoriete segment is,\\ndus hier zijn de cijfers die we tot nu toe hebben:\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Madelief | -      |\\n| Marthijn | 6,5    |\\n| Desiree  | -      |\\n| Bas      | -      |\\n| Wouter   | -      |\\n| Jordy    | 9,1    |\\n|**Totaal**|**9,1** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2421.55212695893!2d4.747626077021011!3d52.63193722793563!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf57b4529f5483%3A0x64f78ef37ae18d32!2sDe%20Waag%2C%20Alkmaar!5e0!3m2!1snl!2snl!4v1734640505003!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"andys","metadata":{"permalink":"/andys","source":"@site/blog/2024-10-01-andys/index.md","title":"Andy\'s Lunchroom","description":"Vandaag gingen we naar Andy\'s lunchroom. Een snacktent naast station Alkmaar Noord, en bekend om hun beste **hotdogs van Europa!**","date":"2024-10-01T00:00:00.000Z","tags":[{"inline":true,"label":"andys","permalink":"/tags/andys"}],"readingTime":0.695,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"andys","title":"Andy\'s Lunchroom","authors":["jordykuhne"],"tags":["andys"],"comments":true},"unlisted":false,"prevItem":{"title":"De Waag","permalink":"/de-waag"},"nextItem":{"title":"Hiennies","permalink":"/hiennies"}},"content":"Vandaag gingen we naar [Andy\'s lunchroom](https://www.andyslunchroom.nl/). Een snacktent naast station Alkmaar Noord, en bekend om hun beste _**hotdogs van Europa!**_\\n\\n![andys lunchroom](andys-cafetaria-19080812574663.jpg)\\n\\n\x3c!-- truncate --\x3e\\n\\nIk had de *Chicago Dog* en een warme chocomelk. De hotdog was heerlijk, en de chocomelk was lekker warm. De rest had ook allemaal hotdogs, en iedereen was zeer tevreden met het eten.\\n\\nHet personeel kan wel wat vriendelijker. Ik werd verbaal aangevallen door een van de medewerkers en was diep geschokt.\\n\\n![alt text](hotdogs.png)\\n\\nDus in conclusie: Personeel kan beter, maar hun hotdogs zijn inderdaad de beste van heel europa.\\n\\n## Cijfers\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Madelief | 8,5    |\\n| Marthijn | 8,3    |\\n| Desiree  | 8,4    |\\n| Bas      | 8,4    |\\n| Jordy    | 1,0    |\\n|**Totaal**|**6,1** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2415.013394132842!2d4.760620061046338!3d52.643738891529686!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf56515f56bf93%3A0xfa19c20dc6e7dfa2!2sAndy&#39;s%20Cafetaria!5e0!3m2!1snl!2snl!4v1727825716971!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"hiennies","metadata":{"permalink":"/hiennies","source":"@site/blog/2024-09-24-hiennies/index.md","title":"Hiennies","description":"Vandaag gingen we naar Hiennies. Een streetfood tent in Heerhugowaard. Volgens vele hebben ze het **beste streetfood van Europa!**","date":"2024-09-24T00:00:00.000Z","tags":[{"inline":true,"label":"hiennies","permalink":"/tags/hiennies"}],"readingTime":0.65,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"hiennies","title":"Hiennies","authors":["jordykuhne"],"tags":["hiennies"],"comments":true},"unlisted":false,"prevItem":{"title":"Andy\'s Lunchroom","permalink":"/andys"},"nextItem":{"title":"Jacky","permalink":"/jacky"}},"content":"Vandaag gingen we naar [Hiennies](https://hiennies.sitedish.shop/). Een streetfood tent in Heerhugowaard. Volgens vele hebben ze het _**beste streetfood van Europa!**_\\n\\n![alt text](image.png)\\n\\n\\n\x3c!-- truncate --\x3e\\n\\nZe hebben een groot menu met niet alleen streetfood, maar ook snackbar gerechten. Zelf had ik een broodje hete kip met een kaassouffl\xe9. De hete kip was best lekker, maar net iets te pittig voor mij. De kaassouffl\xe9 was _very nice_.\\n\\n![alt text](d82fe2c98608068504bf36bea0bf-1.jpg)\\n\\nHet personeel was vriendelijk, maar het duurde wel effe voordat we ons eten kregen. Maar misschien voelt het alleen maar zo omdat we staand in de kou moesten wachten.\\n\\n## Cijfers\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Marthijn | 8,7    |\\n| Bas      | 6,9    |\\n| Jordy    | 10     |\\n|**Totaal**|**8,5** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2419.8720095748195!2d4.82603599363711!3d52.662289353750715!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf543b90877ae3%3A0xd7088eb721d02d5b!2sStreetfood%20By%20Hiennies%20%26%20Bubble%20Tea!5e0!3m2!1snl!2snl!4v1727829332715!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"jacky","metadata":{"permalink":"/jacky","source":"@site/blog/2024-09-17-jacky/index.md","title":"Jacky","description":"Deze week zijn we naar Jacky geweest. Een mooi restaurantje in Alkmaar, waar ze toevalig ook de **beste burgers van Europa hebben!**","date":"2024-09-17T00:00:00.000Z","tags":[{"inline":true,"label":"jacky","permalink":"/tags/jacky"}],"readingTime":0.73,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"jacky","title":"Jacky","authors":["jordykuhne"],"tags":["jacky"],"comments":true},"unlisted":false,"prevItem":{"title":"Hiennies","permalink":"/hiennies"},"nextItem":{"title":"Roberto","permalink":"/roberto"}},"content":"Deze week zijn we naar [Jacky](https://jackyalkmaar.nl/) geweest. Een mooi restaurantje in Alkmaar, waar ze toevalig ook de _**beste burgers van Europa hebben!**_\\n\\n![jacky logo](jacky-alkmaar.jpg)\\n\\n\x3c!-- truncate --\x3e\\n\\nWe hadden alle drie de beroemde Smash Burger besteld.\\nEen heerlijke burger, gesmasht, met cheddar, bacon, sla, tomaat en ui met wat frietjes erbij.\\n\\n![smash burger](images.jpg)\\n\\nMarthijn was helaas een beetje ziek, waardoor we zijn cijfer niet serieus konde nemen. En hij kreeg het ook niet op, dus ik had wel lekker een ander halve burger op. :)\\n\\nHet personeel was ook erg vriendelijk en het eten kwam snel. Voor een snelle lunch in je pauze is dit een mooie plek.\\n\\n![jacky buitenkant](Jacky-Alkmaar-vooraanzicht.jpeg)\\n\\n## Cijfers\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Marthijn | Ziek, telt niet |\\n| Bas      | 7,1    |\\n| Jordy    | 10     |\\n|**Totaal**|**8,6** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2421.3383812753236!2d4.749031777021208!3d52.6357993276492!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf5766bfacba05%3A0x912d806b6f1cf8bf!2sJacky%20Alkmaar!5e0!3m2!1snl!2snl!4v1727828594341!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"roberto","metadata":{"permalink":"/roberto","source":"@site/blog/2024-08-30-roberto/index.md","title":"Roberto","description":"Voor de eerste tent van Tour de la Schrans gingen we naar Restaurant Roberto. Een Italiaans restaurant in Alkmaar, en bekend om hun beste **pizza van Europa!**","date":"2024-08-30T00:00:00.000Z","tags":[{"inline":true,"label":"roberto","permalink":"/tags/roberto"}],"readingTime":0.83,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"roberto","title":"Roberto","authors":["jordykuhne"],"comments":true,"tags":["roberto"]},"unlisted":false,"prevItem":{"title":"Jacky","permalink":"/jacky"},"nextItem":{"title":"Welkom","permalink":"/welkom"}},"content":"Voor de eerste tent van _Tour de la Schrans_ gingen we naar [Restaurant Roberto](https://roberto-alkmaar.nl/). Een Italiaans restaurant in Alkmaar, en bekend om hun beste _**pizza van Europa!**_\\n\\n![Roberto](./pand.jpg)\\n\\n\x3c!-- truncate --\x3e\\n\\nWe hadden meerdere gerechten besteld en gedeeld. We begonnen met de Bruschetta, wat een heerlijke starter was. Daarna had ik een Pizza margherita, wat een lekkere steenoven pizza was. En daarnaast had ik wat frietjes en salade gepakt van de tafel.\\n\\nZe hadden ook een stoofpeer walnoten pizza. Volgens Marthijn is die heerlijk, maar het leek ons allemaal zo smerig dat we het niet hebben geprobeerd. \\n\\n![Meneer Roberto](roberto-alkmaar.jpeg)\\n\\nAl in al was het heerlijk eten, en vriendelijk personeel. We hebben zelfs de man hemzelf, Roberto, gezien maar ik durfde helaas niet om een foto te vragen.\\n\\n## Cijfers\\n\\n| Persoon  | Cijfer |\\n|----------|--------|\\n| Marthijn | 8,3    |\\n| Bas      | 9,1    |\\n| Madelief | 7,0    |\\n| Jordy    | 10     |\\n|**Totaal**|**8,9** |\\n\\n## Locatie\\n\\n<iframe src=\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2422.0190350890566!2d4.734338977020612!3d52.623500128561105!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47cf572c564c2bdb%3A0xe19e91f2fbae5e43!2sRoberto%20bar%20e%20cucina!5e0!3m2!1snl!2snl!4v1727826688913!5m2!1snl!2snl\\" width=\\"600\\" height=\\"450\\" allowfullscreen=\\"\\" loading=\\"lazy\\" referrerpolicy=\\"no-referrer-when-downgrade\\"></iframe>"},{"id":"welkom","metadata":{"permalink":"/welkom","source":"@site/blog/2024-08-28-welkom/index.md","title":"Welkom","description":"Tour de la Schrans, een gepassioneerd concept bedacht door een paar dikke gasten","date":"2024-08-28T00:00:00.000Z","tags":[],"readingTime":0.29,"hasTruncateMarker":true,"authors":[{"name":"Jordy Kuhne","title":"Backend Developer","url":"https://github.com/TECH7Fox","page":{"permalink":"/authors/jordykuhne"},"socials":{"github":"https://github.com/TECH7Fox","linkedin":"https://www.linkedin.com/in/jordy-kuhne/"},"imageURL":"https://avatars.githubusercontent.com/u/32220029?v=4","key":"jordykuhne"}],"frontMatter":{"slug":"welkom","title":"Welkom","authors":["jordykuhne"],"comments":true},"unlisted":false,"prevItem":{"title":"Roberto","permalink":"/roberto"}},"content":"## _Tour de la Schrans_, een gepassioneerd concept bedacht door een paar dikke gasten\\n\\nWelkom bij _Tour de la Schrans_! \x3c!-- truncate --\x3e\\nElke dinsdag gaan we lunchen bij een nieuwe tent in of rondom Alkmaar, en delen we onze ervaringen hier.\\n\\nWe zijn nog op zoek naar een sponsor want dit kost veels te veel geld.\\n\\n\\n![Hotdogs](./hotdogs.png)"}]}}')}}]);